    private static final Map<BlockShape, List<Short>> SPECIAL_BLOCKS = new EnumMap<>(BlockShape.class);
    private static final List<Short> CUBES = new ArrayList<>(360);

    private static void register(BlockShape blockShape, short hexId, byte data, String resourceId) {
        if (blockShape == null) {
            CUBES.add(hexId);
        } else {
            SPECIAL_BLOCKS.computeIfAbsent(blockShape, _ -> new ArrayList<>()).add(hexId);
        }

    }

